import json, importlib.util, os, random
import networkx as nx
spec=importlib.util.spec_from_file_location('solver', os.path.abspath('solver.py'))
mod=importlib.util.module_from_spec(spec)
spec.loader.exec_module(mod)

def random_graph(n, p):
    G=nx.Graph()
    G.add_nodes_from(range(n))
    for i in range(n):
        for j in range(i+1,n):
            if random.random()<p:
                w=random.uniform(0.1,10.0)
                G.add_edge(i,j,weight=w)
    return G

def csr_from_nx(G):
    n=G.number_of_nodes()
    data=[]
    indices=[]
    indptr=[0]
    for i in range(n):
        # neighbors may not be sorted; order doesn't matter
        for j,attrs in G[i].items():
            data.append(attrs['weight'])
            indices.append(j)
        indptr.append(len(data))
    return {'data':data,'indices':indices,'indptr':indptr,'shape':[n,n]}

random.seed(42)
for n in [5,10]:
    G=random_graph(n,0.3)
    csr=csr_from_nx(G)
    out=mod.solve(csr)['distance_matrix']
    ref=dict(nx.all_pairs_dijkstra_path_length(G,weight='weight'))
    ref_mat=[[ref[i].get(j,None) for j in range(n)] for i in range(n)]
    ok=True
    for i in range(n):
        for j in range(n):
            a=out[i][j]
            b=ref_mat[i][j]
            if b is None:
                if a is not None:
                    ok=False
            else:
                if abs(a-b)>1e-6:
                    ok=False
    print('n',n,'ok',ok)
